using namespace std;

class Solution
{
public:
    int maximumElementAfterDecrementingAndRearranging(vector<int> &arr)
    {
        sort(arr.begin(), arr.end());
        int prev = arr[0];
        for (auto const a : arr)
        {
            prev = min(a, prev + 1);
        }
        return prev;
    }
};

class SolutionTest : public testing::Test
{
protected:
    Solution solution;
};

TEST_F(SolutionTest, test_001)
{
    vector<int> arr = {2, 2, 1, 2, 1};
    ASSERT_EQ(2, solution.maximumElementAfterDecrementingAndRearranging(arr));
}

TEST_F(SolutionTest, test_002)
{
    vector<int> arr = {100, 1, 1000};
    ASSERT_EQ(3, solution.maximumElementAfterDecrementingAndRearranging(arr));
}

